import React from 'react';
import './index.css'

function Table (props) {
    return (
        <table>
            <thead>
                <tr>
                    <th>Last Name</th>
                    <th>First Name</th>
                    <th>Email</th>
                    <th>Phone Number</th>
                    <th>Role</th>
                </tr>
            </thead>
        </table>
    )
}

export default Table;
